/* eslint-disable no-undef */
import React from 'react';

const Tweet = ({tweets}) => {

    const keyGenerator = () => '_' + Math.random().toString(36).substr(2, 9)

    return (
    <>
        <div> {/*}
            {tweets.map((thistweet, key) => 
            <div className="tweet" key={key}>
                <p>{thistweet.created_at}</p>
                <p>{thistweet.text}</p> 
                <p>{thistweet.source}</p>
                <p>{thistweet.reply_count} replies and {thistweet.retweet_count} retweets</p>
            </div>
            )}*/}
            {tweets.user && Object.values(tweets.user).map((value, index) =>
                <div key={keyGenerator}>
                    <p>{value.name}</p>
                    {console.log(value.name)}
                </div>
            )}
        </div> 
    </>
    )
} 


export default Tweet;
